window.bookSummaryJSON = "<p><b>An Amazon top 25 best seller.</b></p> <p><b>In the power struggle between two elite groups, one feisty girl will bring them to their knees...</b></p> <p>Life is a cruel game, where only the most ruthless survive. It’s a truth my mother rebelled against, and she paid for it with her life. Now, I play their game. Publicly accepting the destiny that lies in wait for me when I turn 18. But behind closed doors, I plot my escape.&nbsp;</p> <p>Trent, Charlie, and my twin Drew rule the hallways of Rydeville High with arrogance and an iron fist. I execute my role perfectly, hating every second, but they never let me forget my place in this world.</p> <p>Everyone obeys the rules. They have, for generations. Because, our families have always been in control. Until Cam, Sawyer, and Jackson show up. Throwing their new money around. Challenging the status quo. Setting hearts racing with their gorgeous faces, hot bodies, and bad boy attitudes.</p> <p>Battle lines are drawn. Sides are taken. And I’m trapped in the middle, because I made a mistake one fateful night when I gave my V-card to a stranger in a blatant F you to my fiancé.</p> <p>I thought it was the one thing I owned. A precious memory to carry me through each dark day.</p> <p>I couldn’t have been more wrong.</p> <p>Because, the stranger was Camden Marshall, leader of the new elite and my perpetual tormentor. He hates me with a passion unrivaled, and he won’t be the only one. Fire will rain down if the truth is revealed, threatening alliances, and the power struggle will turn vicious.</p> <p>My life will hang in the balance. But I’ll be ready, and I’m not going down without a fight.</p> <p><b>Note: </b>Due to mature content and themes, this audiobook is recommended for listeners aged 18 and over. This is a full-length novel, and it's book one in a planned trilogy. It cannot be listened to as a stand-alone and ends with a cliff-hanger.&nbsp;</p>"; 
